//import './App.css';

function AboutMe() {
  return (
    <div className="About-Me">
      <header align="left">
        <p>
        In my free time, I enjoy smearing big blobs of color across canvases. 
        Here are a few. If you have questions or comments, I'd love to chat. 
        Please direct all painting-related inquiries to myradotzel[at]gmail[dot]com.
        </p>
      </header>
    </div>
  );
}

export default AboutMe;
